module.exports = "<h1 id=\"react-google-maps-loader\">react-google-maps-loader</h1>\n<p><a href=\"https://www.npmjs.org/package/react-google-maps-loader\"><img src=\"https://img.shields.io/npm/v/react-google-maps-loader.svg?style=flat-square\" alt=\"npm package\"></a>\n<a href=\"https://travis-ci.org/xuopled/react-google-maps-loader\"><img src=\"https://img.shields.io/travis/xuopled/react-google-maps-loader/master.svg?style=flat-square\" alt=\"Travis\"></a>\n<a href=\"https://codecov.io/gh/xuopled/react-google-maps-loader\"><img src=\"https://img.shields.io/codecov/c/github/xuopled/react-google-maps-loader.svg?style=flat-square\" alt=\"Codecov\"></a>\n<img src=\"https://img.shields.io/badge/module%20formats-umd%2C%20cjs%2C%20esm-green.svg?style=flat-square\" alt=\"Module formats\"></p>\n<p>React Component to use google maps services into your react applications using a render prop.</p>\n<h2 id=\"getting-started\">Getting started</h2>\n<p><a href=\"https://nodei.co/npm/react-google-maps-loader/\"><img src=\"https://nodei.co/npm/react-google-maps-loader.png?downloads=true&amp;downloadRank=true&amp;stars=true\" alt=\"react-google-maps-loader\"></a></p>\n<p>You can download <code>react-google-maps-loader</code> from the NPM registry via the <code>npm</code> or <code>yarn</code> commands</p>\n<pre><code class=\"lang-shell\">yarn add react-google-maps-loader\nnpm install react-google-maps-loader --save\n</code></pre>\n<p>If you don&#39;t use package manager and you want to include <code>react-google-maps-loader</code> directly in your html, you could get it from the UNPKG CDN</p>\n<pre><code class=\"lang-html\">https://unpkg.com/react-google-maps-loader/dist/react-google-maps-loader.min.js.\n</code></pre>\n<h2 id=\"usage\">Usage</h2>\n<h3 id=\"load-map-only\">Load Map Only</h3>\n<p>This renders when the map is ready, with no loading state.</p>\n<pre><code class=\"lang-javascript\">import React from &quot;react&quot;\nimport ReactGoogleMapLoader from &quot;react-google-maps-loader&quot;\n\nconst App = () =&gt;\n  &lt;ReactGoogleMapLoader\n    params={{\n        key: YOUR_API_KEY, // Define your api key here\n        libraries: &quot;places,geometry&quot;, // To request multiple libraries, separate them with a comma\n    }}\n    render={googleMaps =&gt;\n        googleMaps &amp;&amp; (\n            &lt;div&gt;Google Maps is loaded !&lt;/div&gt;\n        )}\n    /&gt;\n</code></pre>\n<h3 id=\"show-loading-state\">Show Loading State</h3>\n<p>You can show a custom loading state while the user is still online by using the error values.</p>\n<h4 id=\"error-values\">Error Values</h4>\n<ul>\n<li><p><code>[String] Network Error</code> - if the user us offline.</p>\n</li>\n<li><p><code>[String] SDK Authentication Error</code> - if there is a problem loading Google maps due to incorrect keys, going over quota or one of the errors listed in the <a href=\"https://developers.google.com/maps/documentation/javascript/error-messages\">Error Messages Documentation</a>.</p>\n</li>\n<li><p><code>undefined</code> - map loaded correctly.</p>\n</li>\n</ul>\n<pre><code class=\"lang-js\">import React from &quot;react&quot;\nimport ReactGoogleMapLoader from &quot;react-google-maps-loader&quot;\n\nconst App = () =&gt;\n  &lt;ReactGoogleMapLoader\n    params={{\n        key: YOUR_API_KEY, // Define your api key here\n        libraries: &quot;places,geometry&quot;, // To request multiple libraries, separate them with a comma\n    }}\n    render={(googleMaps, error) =&gt;\n        googleMaps ? (\n            &lt;div&gt;\n                {/*Show a custom error if SDK Authentication Error. See N/B 2 below.*/}\n                {error ? error : &quot;Google Maps is loaded !&quot;}\n            &lt;/div&gt;\n        )   :   (\n            &lt;div&gt;\n                {/*Check for network error so loading state ends if user lost connection.*/}\n                {error === &quot;Network Error&quot; ? &lt;p&gt;{error}&lt;/p&gt; : &lt;p&gt;isLoading...&lt;/p&gt;}\n            &lt;/div&gt;\n        )\n    }/&gt;\n</code></pre>\n<p>N/B:</p>\n<ol>\n<li><p>The Google Maps API does not provide errors in the callback but logs them to the console. We grouped all Google Maps errors not related to network connectivity as <code>SDK Authentication Error</code>. Check the console if you get this.</p>\n</li>\n<li><p><code>googleMaps</code> always loads as long as there is no <code>Network Error</code> and the previous state is not cached. So, handle <code>SDK Authentication Errors</code> (See 1. above) in the <code>googleMaps</code> part of the conditional rendering as shown in the code above.</p>\n</li>\n</ol>\n<h2 id=\"demo\">Demo</h2>\n<p>See <a href=\"https://xuopled.github.io/react-google-maps-loader\">Demo page</a></p>\n<h2 id=\"contributing\">Contributing</h2>\n<ul>\n<li>⇄ Pull/Merge requests and ★ Stars are always welcome.</li>\n<li>For bugs and feature requests, please <a href=\"https://github.com/xuopled/react-google-maps-loader/issues/new\">create an issue</a>.</li>\n<li>Pull requests must be accompanied by passing automated tests (<code>npm test</code>).</li>\n</ul>\n<p>See <a href=\"./CONTRIBUTING.md\">CONTRIBUTING.md</a> guidelines</p>\n<h2 id=\"changelog\">Changelog</h2>\n<p>See <a href=\"./CHANGELOG.md\">changelog</a></p>\n<h2 id=\"license\">License</h2>\n<p>This project is licensed under the MIT License - see the <a href=\"./LICENCE.md\">LICENCE.md</a> file for details</p>\n";

